  `device_type` int DEFAULT NULL COMMENT '設備類型 兼容部分AttendanceMod常量,定義設備的類型. EnumBusiness.DeviceEntryMode控制int的值',
  `maincom_id` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '公司ID, 如果是云部储的情况下,则很有用,否则使用MainCom对象NEW一个默认值.',
  `site_id` int NOT NULL DEFAULT '0' COMMENT '设备所在位置(分布式结构) 未指定=0',
  `lib_id` int DEFAULT '0' COMMENT '定義設備控制的人群',
  `lib_name` varchar(128) DEFAULT NULL COMMENT '設備指派的群組的名稱',
  `device_serial_no` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '设备序列号: 电脑以CPU为默认的序列号,手机app,默认的设备序列号是手机IMEI,用于登记为合法的访问设备.',
  `device_config` varchar(4000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'max=4000 因应 EnumCode.SysModuleType的模块类型 面向的对象解析为JSON不同, 如果是DVR设备,则对应的JSON对象是DVR.如果是HIK面型机则对应是HIK FACE的JSON解析对象',
  `is_reverse_hex` bit(1) NOT NULL COMMENT 'from card hex decimal 拍卡的16进制码是否交叉反向解析为10进制',
  `device_entry_mode` int NOT NULL COMMENT 'in/out/undefined',
  `status` int NOT NULL DEFAULT '1' COMMENT 'use Enum type to dinfine the status type',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `task_id` int NOT NULL DEFAULT '0' COMMENT '用於警報模塊的任務,任務指定需要警報的鏡頭 0表示沒有任務,默認值0',
  `task_name` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_general_ci DEFAULT NULL COMMENT '任務那裡 有鏡頭組1 和鏡頭組2 對於鏡頭警報來說很適合.暫時改造成 設備下掛一個任務for 警報任務的. ',
  PRIMARY KEY (`device_id`),
  KEY `device_id` (`device_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9002 DEFAULT CHARSET=utf8mb3 COMMENT='record the infomation of the  edge computing device about serial no, backend running handle,etc... 字段 device_type :EnumBusiness.DeviceEntryMode控制int的值';

